import React from 'react';

 export const Background: React.FC = () => {
  return (
    <div className="relative w-full h-full overflow-hidden">
      <div className="absolute w-full h-full bg-black white-space-nowrap animation-container">
        {Array.from({ length: 50 }, (_, index) => (
          <div key={index} className="inline-block w-16 h-16">
            <div className={`bg-white ${index % 2 === 0 ? 'h-8' : 'h-0'}`} />
            <div className={`bg-black ${index % 2 === 0 ? 'h-8' : 'h-16'}`} />
          </div>
        ))}
      </div>
    </div>
  );
};
